import React, { useState, useEffect } from 'react';
import './GetAllCars'; // Importáljuk a CSS fájlt

export default function AddNewCar(props) {
  const [carData, setCarData] = useState({
    brand: '',
    type: '',
    color: '',
    myear: '',
  });
  const [isUpdateMode, setIsUpdateMode] = useState(false);

  useEffect(() => {
    if (props.carObj && props.carObj.id) {
      setIsUpdateMode(true);
      setCarData({
        brand: props.carObj.brand || '',
        type: props.carObj.type || '',
        color: props.carObj.color || '',
        myear: props.carObj.myear
          ? new Date(new Date(props.carObj.myear).getTime() - new Date().getTimezoneOffset() * 60000)
              .toISOString()
              .split('T')[0]
          : '',
      });
    } else {
      setIsUpdateMode(false);
      setCarData({
        brand: '',
        type: '',
        color: '',
        myear: '',
      });
    }
  }, [props.carObj]);

  const handleChange = (event) => {
    const { name, value } = event.target;
    setCarData({ ...carData, [name]: value });
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    const url = `http://localhost:5000/cars${isUpdateMode ? `/${props.carObj.id}` : ''}`;
    const method = isUpdateMode ? 'PUT' : 'POST';

    try {
      const request = await fetch(url, {
        method: method,
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(carData),
      });

      if (!request.ok) {
        console.error(`Hiba a kérés során (${request.status}): ${request.statusText}`);
        return;
      }

      const response = await request.json();
      props.handleCount();
      console.log(response.message);
      // Reset the form after successful submission if it's a new car
      if (!isUpdateMode) {
        setCarData({ brand: '', type: '', color: '', myear: '' });
      }
    } catch (error) {
      console.error('Hiba történt a kérés küldésekor:', error);
    }
  };

  return (
    <div className="add-new-car-container">
      <h2>{isUpdateMode ? 'Autó szerkesztése' : 'Új autó hozzáadása'}</h2>
      <form onSubmit={handleSubmit} className="car-form">
        <div className="form-group">
          <label htmlFor="brand">Márka</label>
          <input
            type="text"
            id="brand"
            name="brand"
            value={carData.brand}
            onChange={handleChange}
            className="form-control"
            placeholder="Autó márkája"
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="type">Típus</label>
          <input
            type="text"
            id="type"
            name="type"
            value={carData.type}
            onChange={handleChange}
            className="form-control"
            placeholder="Autó típusa"
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="color">Szín</label>
          <input
            type="text"
            id="color"
            name="color"
            value={carData.color}
            onChange={handleChange}
            className="form-control"
            placeholder="Autó színe"
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="myear">Gyártási év</label>
          <input
            type="date"
            id="myear"
            name="myear"
            value={carData.myear}
            onChange={handleChange}
            className="form-control"
            placeholder="Autó gyártási éve-hónap-nap"
            required
          />
        </div>
        <button type="submit" className="btn btn-primary">
          {isUpdateMode ? 'Mentés' : 'Hozzáadás'}
        </button>
        {isUpdateMode && (
          <button type="button" className="btn btn-secondary" onClick={() => setIsUpdateMode(false)}>
            Mégse
          </button>
        )}
      </form>
    </div>
  );
}
